import React, {Component} from 'react';
class App extends Component{
    
    render(){
        const helloArray =["hello Pedza", "hello Vesna", "hello hello"]
        const listOfItems = helloArray.map((item) =>
        <h1 className="col h1Element">{item}</h1>
        );
        return(
            <div className="mainDiv container-fluid text-center justify-content-center">
                {listOfItems}
            </div>
        )
    }
}

export default App;
